    private boolean solution2(int[] nums){
        Map<Integer, Integer> countMap = new HashMap<Integer, Integer>();
        Map<Integer, Integer> endMap = new HashMap<Integer, Integer>();
        for (int x : nums) {
            int count = countMap.getOrDefault(x, 0) + 1;
            countMap.put(x, count);
        }
        for (int x : nums) {
            int count = countMap.getOrDefault(x, 0);
            if (count > 0) {
                int prevEndCount = endMap.getOrDefault(x - 1, 0);
                if (prevEndCount > 0) {
                    countMap.put(x, count - 1);
                    endMap.put(x - 1, prevEndCount - 1);
                    endMap.put(x, endMap.getOrDefault(x, 0) + 1);
                } else {
                    int count1 = countMap.getOrDefault(x + 1, 0);
                    int count2 = countMap.getOrDefault(x + 2, 0);
                    if (count1 > 0 && count2 > 0) {
                        countMap.put(x, count - 1);
                        countMap.put(x + 1, count1 - 1);
                        countMap.put(x + 2, count2 - 1);
                        endMap.put(x + 2, endMap.getOrDefault(x + 2, 0) + 1);
                    } else {
                        return false;
                    }
                }
            }
        }
        return true;
    }

    private boolean solution(int[] nums){
        if (nums.length < 3)
            return false;
        int preNum, currentNum, count = 1, listNum = 0;
        Map<Integer, Integer> numCount = new HashMap<>();
        Map<Integer, Integer> endNumForList = new HashMap<>();
        for (int i = 0; i < nums.length; i++) {
            numCount.put(nums[i], numCount.getOrDefault(nums[i], 0) + 1);
        }

        for (int i = 0; i < nums.length; i++) {
            currentNum = nums[i];
            if (numCount.get(currentNum) == 0)
                continue;
            listNum = endNumForList.getOrDefault(currentNum-1, 0);
            if (listNum == 0){
                for (int j = 0; j < 3; j++) {
                    if (numCount.getOrDefault(currentNum+j,0) <= 0)
                        return false;
                    numCount.put(currentNum+j, numCount.get(currentNum+j)-1);
                }
                endNumForList.put(currentNum+2, endNumForList.getOrDefault(currentNum+2, 0) + 1);
            }else {
                numCount.put(currentNum, numCount.get(currentNum) - 1);
                endNumForList.put(currentNum-1, listNum-1);
                endNumForList.put(currentNum, endNumForList.getOrDefault(currentNum, 0) + 1);
            }
        }
        return true;
    }

    public boolean isPossible(int[] nums){
        return solution(nums);
    }

